DROP TABLE df_brasil;
CREATE TABLE df_brasil(
   line                  INTEGER  NOT NULL PRIMARY KEY 
  ,regiao                VARCHAR(6) NOT NULL
  ,estado                VARCHAR(30)
  ,municipio             VARCHAR(30)
  ,coduf                 INTEGER  NOT NULL
  ,codmun                VARCHAR(30)
  ,codRegiaoSaude        VARCHAR(30)
  ,nomeRegiaoSaude       VARCHAR(30)
  ,data                  VARCHAR(10)  NOT NULL
  ,semanaEpi             INTEGER  NOT NULL
  ,populacaoTCU2019      NUMERIC(11,1) NOT NULL
  ,casosAcumulado        INTEGER  NOT NULL
  ,casosNovos            INTEGER  NOT NULL
  ,obitosAcumulado       INTEGER  NOT NULL
  ,obitosNovos           INTEGER  NOT NULL
  ,Recuperadosnovos      NUMERIC(9,1)
  ,emAcompanhamentoNovos NUMERIC(8,1)
  ,interiormetropolitana VARCHAR(30)
);
